import logo from './logo.svg';
import './App.css';

import { Button, Box } from '@material-ui/core';

function HomeButton() {
  return (
    <Button variant="outline">
      Home
    </Button>
  );
}

function App() {
  return (
    <Box bgcolor="primary.main" color="primary.main">
      <HomeButton />
    </Box>
  );
}

